t.exports=JSON.parse('{"data":[{"title":"Adafruit","githubUrl":"https://github.com/adafruit","inviteCode":"adafruit","logo":"adafruit.svg","quote":"Adafruit, a USA manufacturer of educational open-source hardware and software, uses Discord for creating Code + Community.","quoteSourceUrl":"https://www.adafruit.com/about/"},{"title":"AdonisJs","githubUrl":"https://github.com/adonisjs","inviteCode":"k5myGAz","logo":"adonis.svg","quote":"Discord is a very powerful tool that has been made initially for gamers but that can be used for any corporation. It helps us being close to our community."},{"title":"Amethyst Game Engine","githubUrl":"https://github.com/amethyst","inviteCode":"GnP5Whs","logo":"amethyst.png","quote":"Discord has made communicating with and helping our users in real time a breeze. Having a modern and easily accessible chat has been critical in our growth."},{"title":"Angular","githubUrl":"https://github.com/angular/angular","inviteCode":"angular","logo":"angular.svg","quote":"Imagine asking a question and having GDEs and library authors answer, as well as awesome members of the @angular community! That\'s been my experience. Join the conversation if you haven\'t already.","quoteSourceUrl":"https://twitter.com/ub3rh4xor/status/1306601883088293889"},{"title":"Appwrite","githubUrl":"https://github.com/appwrite","inviteCode":"GSeTUeA","logo":"appwrite.svg","quote":"Discord allowed us to provide better support for our community and a centralized place to discuss and elaborate on future versions."},{"title":"Augur","githubUrl":"https://github.com/AugurProject","inviteCode":"aNBTq55","logo":"augur.svg","quote":"Discord has many of the same features of Slack, however they... give us better community moderation tools. Security features such as link checking and validation is built in. Discord will allow us to grow our online community without any restrictions with our upcoming launch.","quoteSourceUrl":"https://medium.com/@AugurProject/adopting-discord-10d1b30bfcbb"},{"title":"Blink","githubUrl":"https://github.com/blinksh/blink","inviteCode":"ZTtMfvK","logo":"blink.png"},{"title":"Buefy","githubUrl":"https://github.com/buefy/buefy","inviteCode":"ZkdFJMr","logo":"buefy.png"},{"title":"BuildCraft","githubUrl":"https://github.com/BuildCraft/BuildCraft","inviteCode":"BuildCraft","logo":"buildcraft.png","quote":"Discord has allowed us to get the community organized again, offering support, talking about the future of the mod and much more."},{"title":"ChatTriggers","githubUrl":"https://github.com/ChatTriggers","inviteCode":"chattriggers","logo":"chattriggers.svg","quote":"Discord allows us to communicate effectively with our users, allowing for everyone to contribute to the development and progression of our open source project."},{"title":"DenizenScript","githubUrl":"https://github.com/DenizenScript","inviteCode":"Q6pZGSR","logo":"denizenscript.png","quote":"Discord is the perfect live chat and interaction platform for the DenizenScript team to provide support to our users and teach new programmers."},{"title":"Deno","githubUrl":"https://github.com/denoland","inviteCode":"deno","logo":"deno.png","quote":"Community engagement has been a lot more active since we moved to Discord from Gitter."},{"title":"disease.sh","githubUrl":"https://github.com/disease-sh","inviteCode":"cEDxzfW","logo":"disease-sh.svg","quote":"Discord helped us find bugs and support users of our API and help them build their applications."},{"title":"Docusaurus","githubUrl":"https://github.com/facebook/Docusaurus","inviteCode":"docusaurus","logo":"docusaurus.png"},{"title":"DVC","githubUrl":"https://github.com/iterative/dvc","inviteCode":"dvwXA2N","logo":"dvc.svg","quote":"We choose Discord, because it is a great platform - open, reliable, easy-to-access. With Discord we can focus on growing our community without any limitations. ","quoteSourceUrl":"https://dvc.org/"},{"title":"Electron","githubUrl":"https://github.com/electron","inviteCode":"electronjs","logo":"electron.svg","quote":"Discord provides an open and easy-to-moderate community space for the Electron community, allowing us to focus on engaging with our community rather than how to manage a community in tools that aren\'t explicitly built for that."},{"title":"Elixir","githubUrl":"https://github.com/elixir-lang","inviteCode":"elixir","logo":"elixir.png"},{"title":"Ember.js","githubUrl":"https://github.com/emberjs","inviteCode":"zT3asNS","logo":"emberjs.png"},{"title":"EngineHub","githubUrl":"https://github.com/EngineHub","inviteCode":"enginehub","logo":"enginehub.svg","quote":"Discord has allowed us to massively streamline support requests, and created a dynamic community around our projects."},{"title":"EtherGem","githubUrl":"https://gitlab.com/ethergem","inviteCode":"zav3EkW","logo":"ethergem.png"},{"title":"Fedora","githubUrl":"https://fedoraproject.org","inviteCode":"fedora","logo":"fedora.svg","quote":"The Fedora Project is a community of people working together to build a free and open source software platform and to collaborate on and share user-focused solutions built on that platform. Or, in plain English, we make an operating system and we make it easy for you do useful stuff with it. Our four foundations are Freedom, Friends, Features, and First. Discord is one of the networks that helps enable the Friends to connect."},{"title":"Flarum","githubUrl":"https://github.com/flarum/flarum","inviteCode":"3fnPSjA","logo":"flarum.svg","quote":"Discord shines not only in terms of performance, but more so in regards to design and ux. There is no other decent communication client able to match Discord, period."},{"title":"Flutter","githubUrl":"https://github.com/flutter/flutter","inviteCode":"rflutterdev","logo":"flutter.png"},{"title":"Formik","githubUrl":"https://github.com/jaredpalmer/formik","inviteCode":"BYTdAgs","logo":"formik.png"},{"title":"Gatsby","githubUrl":"https://github.com/gatsbyjs/gatsby","inviteCode":"5tdtA9k","logo":"gatsby.svg","quote":"Discord allowed us to create a community hub to all things related to Gatsby. It enables us to foster an open and welcoming environment for all people. We love to chat with our awesome community."},{"title":"Gitea","githubUrl":"https://github.com/go-gitea/gitea","inviteCode":"sRC9wMU","logo":"gitea.svg"},{"title":"Godot Engine","githubUrl":"https://github.com/godotengine/","inviteCode":"zH7NUgz","logo":"godot.svg","quote":"This server allows the engine users to help one another, as well as showcase creations and communicate with some of the official developers behind the engine."},{"title":"GraphQL","githubUrl":"https://github.com/graphql","inviteCode":"ef2h6QM","logo":"graphql.svg"},{"title":"Gridcoin","githubUrl":"https://github.com/gridcoin-community","inviteCode":"jf9XX4a","logo":"gridcoin.png","quote":"Discord allows our community members to communicate directly with developers, and developers to easily engage with the community. We use it extensively for community support and interaction."},{"title":"Gridsome","githubUrl":"https://github.com/gridsome/gridsome","inviteCode":"daeay6n","logo":"gridsome.svg","quote":"Discord lets us have a fun and engaging place for our fast growing Gridsome Community. Discord is fast and has the perfect tools for building a developer community."},{"title":"Groestlcoin","githubUrl":"https://github.com/Groestlcoin","inviteCode":"tVQ43rA","logo":"Groestlcoin.png","quote":"We used to use Slack for the primary form of communication with our community, but since moving to Discord, everything has been so much simpler, from simply inviting new users without restrictions, to moderating the chat, everything is so much easier and cleaner.  We have since completely closed down our Slack social channel."},{"title":"Hasura","githubUrl":"https://github.com/hasura/graphql-engine","inviteCode":"vBPpJkS","logo":"hasura.svg","quote":"We moved to Discord when messages started disappearing on Slack. Discord makes it really easy for users to be a part of multiple servers and this is truly great for our GraphQL developer community, who are usually part of Reactiflux, Vue Land etc. too.","quoteSourceUrl":"https://blog.hasura.io/we-are-moving-to-discord-d01e4e6d31b0"},{"title":"HearthSim","githubUrl":"https://github.com/HearthSim","inviteCode":"hearthsim","logo":"hearthsim.svg","quote":"Discord powers our open source developer community, our company\'s virtual offices and our end-user community. We\'re huge fans."},{"title":"Home Assistant","githubUrl":"https://github.com/home-assistant","inviteCode":"c5DvZ4e","logo":"homeasst.svg","quote":"It\'s allowed more integrated communication between the developers and users helping to fix issues faster as well as encourage new developers to join/contribute. The features of Discord allow us to better direct people to specific channels for help with their niche issues as well as quickly distribute information about any issues that may impact many users","quoteSourceUrl":"https://home-assistant.io/blog/2017/07/03/home-assistant-is-moving-to-discord/"},{"title":"IntellectualSites","githubUrl":"https://github.com/IntellectualSites","inviteCode":"KxkjDVg","logo":"IntellectualSites.svg","quote":"Discord provides us a platform to help people resolving issues, discussing possible features and communicating with other contributors."},{"title":"Jest","githubUrl":"https://github.com/facebook/jest","inviteCode":"reactiflux","logo":"jest.png"},{"title":"JetBrains","githubUrl":"https://github.com/JetBrains","inviteCode":"jetbrains","logo":"jetbrains.png","quote":"The JetBrains Community Discord server allows for JetBrains plugin developers to connect and chat about the open-source IntelliJ platform, as well as for the global JetBrains IDE community to come together in a single safe space to chat, have a good time and get help."},{"title":"Laravel Tenancy","githubUrl":"https://github.com/tenancy","inviteCode":"53PWMwb","logo":"laravel-tenancy.svg","quote":"Discord connects Laravel developers all around the world to create amazing SaaS apps using the tenancy packages. As a communication tool, Discord has proven to be much more superior then any (professional) alternative."},{"title":"LBRY","githubUrl":"https://github.com/lbryio/","inviteCode":"Z3bERWA","logo":"lbry.png","quote":"LBRY is a free, open, and community-run digital marketplace,You own your data. You control the network. Indeed, you are the network, Hollywood films, college lessons, amazing streamers and more are on the first media network ruled by you!","quoteSourceUrl":"https://lbry.io"},{"title":"LibreNMS","githubUrl":"https://github.com/librenms/librenms","inviteCode":"librenms","logo":"librenms.svg","quote":"Discord has improved communication allowing LibreNMS to continue to scale the community of this fully featured network monitoring system. A low barrier to entry and a bridge to IRC have made it easier than ever for LibreNMS users to collaborate, helping each other with great features like code highlighting, screen sharing, and voice communication.","quoteSourceUrl":"https://www.librenms.org"},{"title":"Lindacoin","githubUrl":"https://github.com/TheLindaProjectInc","inviteCode":"SHNjQBv","logo":"lindacoin.png"},{"title":"LinuxGSM","githubUrl":"https://github.com/GameServerManagers/LinuxGSM","inviteCode":"UM4VTpK","logo":"linuxgsm.svg","quote":"Discord is a great cross-platorm tool to support a community of gamers who want to setup their own Linux game server. Making it easy for everyone to help and collaborate together."},{"title":"LuckPerms","githubUrl":"https://github.com/lucko/LuckPerms","inviteCode":"W3FzxHA","logo":"luckperms.svg","quote":"We use Discord to provide help and support, as well as for chatting to users about upcoming updates and the process of contributing to the project!","quoteSourceUrl":"https://luckperms.github.io/"},{"title":"Lutris","githubUrl":"https://github.com/lutris","inviteCode":"Pnt5CuY","logo":"lutris.png","quote":"Discord has allowed us to build a great community of passionate Linux gamers and provide better support for Lutris."},{"title":"Luvit","githubUrl":"https://github.com/luvit/luvit","inviteCode":"luvit","logo":"luvit.png","quote":"Discord helped us organize the Luvit community and made it easier for people to find and contribute to Luvit"},{"title":"Manim","githubUrl":"https://github.com/ManimCommunity/manim","inviteCode":"sgKMvMNhxh","logo":"manim.svg","quote":"The community around Manim utilizes Discord not only as a platform where users can get help with using the framework when creating their own manimations, but also for coordination of the development itself -- and of course, it is a great place to hang out and chat about mathematics and animations."},{"title":"mcMMO","githubUrl":"https://github.com/mcMMO-Dev/mcMMO","inviteCode":"mcmmo","logo":"mcMMO.svg","quote":"Discord is used extensively to provide support, listen to feedback, and improve the project."},{"title":"MMD","githubUrl":"https://github.com/MinecraftModDevelopment","inviteCode":"EDbExcX","logo":"mmd.png","quote":"We use Discord to enable communication between hundreds of developers, and thousands of players who use their projects."},{"title":"Mod Organizer","githubUrl":"https://github.com/Modorganizer2","inviteCode":"ewUVAqyrQX","logo":"modorganizer.svg","quote":"Discord allows our users to chat with the developers directly, and allow developers to get direct feedback regarding bugs and new features"},{"title":"Mudlet","githubUrl":"https://github.com/Mudlet/Mudlet","inviteCode":"rmFG7Wr","logo":"mudlet_icon_minified_bw.png","quote":"Using Discord to help Users connect to 1000\'s of MUD Servers and Mudlet developers to connect to each other..."},{"title":"Myst Language","githubUrl":"https://github.com/myst-lang/myst","inviteCode":"8FtMeac","logo":"myst.svg","quote":"Discord is by far the best place to start a fledgling community like ours with an incredibly low barrier-to-entry and beautifully simple interface, but also providing powerful tools and infrastructure to grow massively (should that ever happen) without paywalls or having to switch services."},{"title":"NestJS","githubUrl":"https://github.com/nestjs","inviteCode":"G7Qnnhy","logo":"nestjs.svg","quote":"Discord both strengthened our community and dramatically improved discussion amongst the developers."},{"title":"NgRx","githubUrl":"https://github.com/ngrx/platform","inviteCode":"cEbHasx","logo":"ngrx.svg","quote":"Have you joined the NgRx Discord yet? It\'s open to everyone! Come hang out and chat with team members and the community","quoteSourceUrl":"https://twitter.com/ngrx_io/status/1306737080878366725"},{"title":"Nuxt.js","githubUrl":"https://github.com/nuxt/nuxt.js","inviteCode":"ps2h6QT","logo":"nuxtjs.svg","quote":"Discord allows Nuxt.js core team to chat and take decisions together in real-time. It engages our open source community to ask questions, get feedbacks for their projects and learn from each others."},{"title":"OBS Studio","githubUrl":"https://github.com/obsproject/obs-studio","inviteCode":"obsproject","logo":"obsproject.svg","quote":"Discord helps the OBS Project maintainers, contributors, volunteers, users, and community at large keep in touch with one another in a single centralized and organized location."},{"title":"OpenDota","githubUrl":"https://github.com/odota","inviteCode":"0o5SQGbXuWCNDcaF","logo":"opendota.svg"},{"title":"openSUSE","githubUrl":"https://github.com/openSUSE","inviteCode":"opensuse","logo":"openSUSE.svg","quote":"openSUSE is a community based project. When the community brought up the idea of a Discord server, it only made sense to create one. We try our best to help people with all their tech support needs and enable people to contribute in many different ways. It\'s our mission to keep openSUSE community focused and growing. Utilising many platforms lets us focus on understanding users more so we can adjust and grow."},{"title":"OpenTK","githubUrl":"https://github.com/opentk","inviteCode":"6HqD48s","logo":"opentk.png","quote":"Discord allows our users to chat with the developers, maintainers, and other users of OpenTK. If these users want help, you know they\'ll get it fast!"},{"title":"OpenXcom","githubUrl":"https://github.com/OpenXcom/OpenXcom","inviteCode":"kd5UDeT","logo":"openxcom.svg","quote":"Discord made communication between developers and players much easier."},{"title":"Organizr","githubUrl":"https://github.com/causefx/organizr","inviteCode":"TrNtY7N","logo":"organizr.png"},{"title":"osu!","githubUrl":"https://github.com/ppy/osu","inviteCode":"ppy","logo":"osu.svg","quote":"All development discussion surrounding our game, the underlying game framework, community organisation and management happens on Discord. It is indispensible.","quoteSourceUrl":"https://osu.ppy.sh"},{"title":"Panda3D","githubUrl":"https://github.com/panda3d/panda3d","inviteCode":"UyepRMm","logo":"panda3d.png","quote":"Our Discord server has enabled us not only to improve communication among developers, but also to foster an open community in which people are happy to help out fellow developers."},{"title":"PIVX","githubUrl":"https://github.com/pivx-project","inviteCode":"jzqVsJd","logo":"pivx.png","quote":"Private Instant Verified Transaction (PIVX), a digital currency focused on privacy and fast transactions uses Discord as a platform to engage with our users"},{"title":"PlaceholderAPI","githubUrl":"https://github.com/PlaceholderAPI","inviteCode":"FtArYRQ","logo":"placeholderapi.png","quote":"Discord allows us to provide all our users from around the world with blazing fast live support."},{"title":"Poi","githubUrl":"https://github.com/egoist/poi","inviteCode":"2t5mdCz","logo":"poi.png"},{"title":"Poimandres","githubUrl":"https://github.com/pmndrs","inviteCode":"poimandres","logo":"poimandres.svg","quote":"Discord has been amazing for accelerating the development of React Spring and React Three Fiber. Screen sharing and instant communication have been pivotal in resolving bugs and coordinating with our contributors."},{"title":"Pterodactyl","githubUrl":"https://github.com/pterodactyl","inviteCode":"QRDZvVm","logo":"pterodactyl.svg","quote":"We love Discord, we use it as our main platform for updates, support, and discussion...Discord even replaced our forums!"},{"title":"Quasar","githubUrl":"https://github.com/quasarframework/quasar","inviteCode":"5TDhbDg","logo":"quasar.svg"},{"title":"Quick.db","githubUrl":"https://github.com/Plexi-Development/quick.db","inviteCode":"plexidev","logo":"plexiLogo.png","quote":"We use Discord as the primary platform for our project to collaborate on and share our database entry system whilst gaining instant feedback through the great amount of members within the active coding community. We are able to enhance and develop our project on a weekly basis by directly contacting the users involved of which has allowed us to create a method between the community and developers a chance for all users to contribute along with the ease of use regardless of Node.js Development knowledge.  We have created a user-friendly database entry system with a quick and resourceful team to assist those who need guidance."},{"title":"Ravencoin","githubUrl":"https://github.com/RavenProject","inviteCode":"44APdew","logo":"Ravencoin.png"},{"title":"React Native Firebase","githubUrl":"https://github.com/invertase/react-native-firebase","inviteCode":"C9aK28N","logo":"rnfirebase.svg","quote":"We tried Gitter, we tried Slack and then we loved Discord. It provides us with far more customisation than the previous two - especially in regards to user roles."},{"title":"Reactiflux","githubUrl":"https://github.com/reactiflux","inviteCode":"reactiflux","logo":"reactiflux.svg","quote":"Discord is the easiest platform to join... All they need to do is provide a name. No permission granting, no password, no email confirmation... This is critically useful for us, and will make Reactiflux even more open and accessible.","quoteSourceUrl":"https://reactjs.org/blog/2015/10/19/reactiflux-is-moving-to-discord.html"},{"title":"ReasonML","githubUrl":"https://github.com/facebook/reason","inviteCode":"reasonml","logo":"reasonml.png"},{"title":"Redux","githubUrl":"https://github.com/reactjs/redux","inviteCode":"aD26W3P","logo":"redux.svg"},{"title":"Relay","githubUrl":"https://github.com/facebook/relay","inviteCode":"reactiflux","logo":"relay.svg"},{"title":"Rigs of Rods","githubUrl":"https://github.com/RigsOfRods/rigs-of-rods","inviteCode":"rigsofrods","logo":"rigsofrods.png"},{"title":"RiiConnect24","githubUrl":"https://github.com/RiiConnect24","inviteCode":"b4Y7jfD","logo":"riiconnect24.svg","quote":"Discord is by far the best chat service around. We have grown a close-knit community with it, and everyone enjoys using it."},{"title":"RLBot","githubUrl":"https://github.com/RLBot/RLBot","inviteCode":"29sFUCq","logo":"RLBot.png","quote":"Discord is THE place where we plan the project, organize tournaments, help our users, and build a community."},{"title":"RPCS3","githubUrl":"https://github.com/RPCS3/rpcs3","inviteCode":"a6zm2T8","logo":"rpcs3.svg","quote":"RPCS3 relies heavily on Discord. With over 3,000 people online at nearly any given time and over 28,000 in the server, RPCS3s Discord is one of the largest, if not the largest, for an open-source software project. In addition to providing a community where people can discuss RPCS3s progress, games they play on it, and sharing screenshots from those games, it actively contributes to development by given the developers real-time chats where they can discuss with each other and with the public at large about how to fix issues.","quoteSourceUrl":"https://rpcs3.net/blog/2018/05/20/progress-report-april-2018/"},{"title":"Rupaya","githubUrl":"https://github.com/rupaya-project/rupaya","inviteCode":"tJ3UWSP","logo":"rupaya.png"},{"title":"Rust","githubUrl":"https://github.com/rust-lang","inviteCode":"rust-lang","logo":"rust.svg"},{"title":"Scala","githubUrl":"https://github.com/scala","inviteCode":"scala","logo":"scala.png","quote":"The Scala Programming Language."},{"title":"SEGS","githubUrl":"https://github.com/Segs","inviteCode":"t4wr8A9","logo":"segs.png","quote":"Super Entity Game Server"},{"title":"Semux","githubUrl":"https://github.com/semuxproject/","inviteCode":"9yJGkr3","logo":"semux.svg"},{"title":"Sentry.io","githubUrl":"https://github.com/getsentry/sentry","inviteCode":"sentry","logo":"sentry.svg","quote":"Sentry uses Discord as secondary discussion platform besides its forums, and for staying in touch with the most active community members."},{"title":"ShareX","githubUrl":"https://github.com/ShareX/ShareX","inviteCode":"ShareX","logo":"sharex.svg","quote":"We use Discord as our main communication channel with our users. When we are adding new features we can discuss it with users and get their feedback. It is also helpful for users to get support more quickly too, because when we are not available there will still be other users who can help with answering questions."},{"title":"Sia","githubUrl":"https://github.com/NebulousLabs/Sia","inviteCode":"sia","logo":"sia.svg","quote":"Discord... was specifically built for huge online communities. Its intended audience is gamers, but many large communities have switched from Slack to Discord, including development communities...","quoteSourceUrl":"https://blog.sia.tech/sia-is-moving-from-slack-to-discord-195f87feb6a6"},{"title":"Slimefun","githubUrl":"https://github.com/Slimefun","inviteCode":"slimefun","logo":"slimefun.svg","quote":"We use Discord to engage with our global community by answering questions, taking suggestions and providing them with the latest news about the project."},{"title":"SpongePowered","githubUrl":"https://github.com/spongepowered","inviteCode":"PtaGRAs","logo":"spongepowered.png","quote":"Discord allowed us to connect better with our community offering support and resources for developers and users in a central location."},{"title":"Starship","githubUrl":"https://github.com/starship/starship","inviteCode":"starship","logo":"starship.svg","quote":"Discord has made it easy for provide support and collaborate on the development of Starship in real-time."},{"title":"Tachiyomi","githubUrl":"https://github.com/tachiyomiorg/tachiyomi","inviteCode":"tachiyomi","logo":"tachiyomi.png","quote":"Discord is a place where the community provides support for each other, freeing up GitHub issues."},{"title":"Tailwind CSS","githubUrl":"https://github.com/tailwindcss/tailwindcss","inviteCode":"7NF8GNe","logo":"tailwindcss.svg","quote":"Discord is the best way for the Tailwind CSS community to collaborate in real-time."},{"title":"TES3MP","githubUrl":"https://github.com/TES3MP/openmw-tes3mp","inviteCode":"ECJk293","logo":"tes3mp.png","quote":"Discord helps us provide immediate support to our players and keeps us in touch with them every day in a way that is far more personal and social than our forums and subreddit."},{"title":"Testing Library","githubUrl":"https://github.com/testing-library","inviteCode":"testing-library","logo":"testinglibrary.png","quote":"The Testing Library support community has moved from Spectrum to Discord, allowing for simpler realtime discussions and additional channels for collaborators and maintainers","quoteSourceUrl":"https://testing-library.com/"},{"title":"Tokio","githubUrl":"https://github.com/tokio-rs","inviteCode":"tokio","logo":"tokio.png","quote":"We certainly think it\'s the most convenient platform for our communications."},{"title":"TranslucentTB","githubUrl":"https://github.com/TranslucentTB","inviteCode":"translucenttb","logo":"translucenttb.svg","quote":"We leverage Discord to coordinate development efforts, as well as providing quick support and friendly chat to our users."},{"title":"TypeScript","githubUrl":"https://github.com/microsoft/TypeScript","inviteCode":"typescript","logo":"typescript.svg"},{"title":"Ubiq","githubUrl":"https://github.com/ubiq","inviteCode":"XaqzJB4","logo":"ubiq.svg","quote":"We\'ve really enjoyed the swap to discord where we can provide an intuitive new member experience while protecting existing members from phishing and scams. This is key as we expand our bot capability to blockchain interaction like tipping."},{"title":"UIkit","githubUrl":"https://github.com/uikit","inviteCode":"NEt4Pv7","logo":"uikit.svg","quote":"Discord is the easiest way to connect with fellow UIkit users and developers. It became the heartbeat of our community and is the best tool we\'ve used yet.","quoteSourceUrl":"https://getuikit.com"},{"title":"Vapor","githubUrl":"https://github.com/vapor/vapor","inviteCode":"vapor","logo":"vapor.svg"},{"title":"Vertcoin","githubUrl":"https://github.com/vertcoin-project","inviteCode":"vertcoin","logo":"vertcoin.png"},{"title":"ViaVersion","githubUrl":"https://github.com/ViaVersion","inviteCode":"BhvNdkQ","logo":"viaversion.svg","quote":"Discord allows us to provide help to the users of our project without the hassle of IRC."},{"title":"Vue Material","githubUrl":"https://github.com/vuematerial/vue-material","inviteCode":"vuematerial","logo":"vue-material.svg"},{"title":"Vue.js","githubUrl":"https://github.com/vuejs","inviteCode":"HBherRA","logo":"vuejs.svg","quote":"The discussion is about how manageable Gitter currently is with over 10k users on gitter.im/vuejs/vue in which someone can easily get lost...[T]he plan right now is to switch to Discord which seems to be an easier to follow product.","quoteSourceUrl":"https://vuejsfeed.com/blog/gitter-chat-for-vue-js-is-moving-to-discord"},{"title":"Vuesax","githubUrl":"https://github.com/lusaxweb/vuesax","inviteCode":"2kHwpfe","logo":"vuesax.png"},{"title":"Vuetify","githubUrl":"https://github.com/vuetifyjs","inviteCode":"s93b7Fv","logo":"vuetify.svg","quote":"We started using Discord as we opened up Patreon. It integrated flawlessly and provided us with a platform to help recognize our contributors. Thank you!"},{"title":"Yarnpkg","githubUrl":"https://github.com/yarnpkg","inviteCode":"yarnpkg","logo":"yarnpkg.svg","quote":"Discord helped us get in touch with Yarn\'s contributors, and empowered them to become maintainers in the process."}]}')
